import React from 'react';
import { Grid,Container } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

export const Filter = ({fil}) => {
    return (
        <Container>
            <Grid container 
                                direction="row" 
                                alignItems="center" >
              <span>{fil}</span>
            </Grid>
        </Container>
    )
}
